import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import TableHeader from "./TableHeader"
import TableData from "./TableData"

function App() {
  return (

    <div>
      <Header />
      <h3 className="tableTitle" >Data List</h3> 
      <table className="table">
      <TableHeader />
      <tbody>
      <TableData />
      </tbody>
      </table>
      <Footer />
    </div>

  );
}

export default App;
